  "excerpt": "<p><img src=\"/posts/11/1.jpg\" alt=\"\"></p>\n<p>Laikam rudens iestāšanās ir tas mirklis, kad laiks aktīvāku darbošanos ar radio laist ziemas guļā, bet vēl gan kaut ko darīt tomēr gribas. 29. septembrī bijām noorganizējušies strādāt ēterī no “Redāns” nocietinājuma “World Castles Award” projekta ietvaros.</p>\n<p>Komandā: <strong>YL3BF</strong>, <strong>YL2QG</strong> un <strong>YL3ALK</strong>; izsaukuma signāls: <strong>YL3BF/p</strong>; WCA: <strong>YL-00104</strong>; № CASTLES: <strong>K-025</strong>; vietas kvadrāts: <strong>KO06MN</strong>.  <a href=\"http://wcagroup.org/?p=11947\" target=\"_blank\" rel=\"noopener noreferrer\">Objekta apraksts<OutboundLink/></a>.</p>\n<p>Liels paldies <strong>YL2UI</strong>, kas kopā ar <strong>YL3BF</strong> piektdien, uzvilka antenas, pretējā gadījumā būtu stipri izmirkuši - svētdiena bija visnotaļ nokrišņiem bagāta.</p>\n<p>Ar divām deltām uz 40m un 20m, <strong>TRX: TS-570d (100W)</strong>, kopā <strong>46 QSO</strong> uz <strong>SSB</strong>. Pirmās divas stundas gandrīz pilnīgs klusums, aktivitāte ik palaikam parādījās, DxHeat rāda, ka esam pat mazliet spototi, izplatība gan ienesa savas korekcijas.</p>\n",
